package com.wjp.contest.leetcode_2021_11_7;

import java.util.HashSet;
import java.util.Set;

class Contest2 {
    public static void main(String[] args) {
        Solution solution = new Contest2().new Solution();
        System.out.println(solution.countVowels(""));
    }

    class Solution {
        public long countVowels(String word) {
            int n = word.length();
            long  res = 0;

            for (int i = 0; i < n; i++) {
                for (int j = i; j < n; j++) {
                    for (int k = i; k <= j; k++) {
                        int count = 0;
                        if (isVowel(word.charAt(k))) {
                            count++;
                        }
                        res += count;
                    }
                }
            }
            return res;
        }

        boolean isVowel(char ch) {
            return ch == 'a' || ch == 'e' || ch == 'i' || ch == 'o' || ch == 'u';
        }
    }
}